const Hero = () => {
  return (
    <div className='container' id="supportHero">
      <div className='row p-5 mt-5 mb-5'>
        <h3 > Support Portal</h3>
        {<a href="#">Track Tickets</a> }
      </div>
    </div>
  )
}

export default Hero;
